import React, { Component} from 'react';
import  InputRange  from './InputSlider';

class noValueSlider extends Component {
  handleOnChange = (e) => {
    this.setState({ value: e.target.value });
  }
    render() {
        return (
            <form className="form">  
                <div className="row">
                    <div className="col-md-2">
                        <p>Enable</p>
                    </div>
                    <div className="col-md-7">
                        <div className="flex-div">
                            <InputRange value={0} min={0} max={100}  onChange={this.handleOnChange}/> 
                            <InputRange value={50} min={0} max={100} /> 
                            <InputRange value={100} min={0} max={100} /> 
                        </div>
                    </div>
                    <div className="col-md-3">
                        <div className="flex-div">
                            <InputRange min={30} max={80} step={2}/>
                        </div>
                    </div>
                </div>
            </form>
        );
    }
}


export default noValueSlider;
